import React, { useState } from 'react';
import './style.css';
import 'boxicons/css/boxicons.min.css';
import InputField from '../common/InputField';
import { Link } from 'react-router-dom';

const RegisterPage: React.FC = () => {
  const [formData, setFormData] = useState({
    email: '',
    username: '',
    password: '',
    confirmPassword: '',
  });

  const [passwordsNotMatch, setPasswordsNotMatch] = useState(false);

  const handleInputChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    const {name, value} = e.target;
    setFormData((prev) => ({
      ...prev,
      [name]: value,
    }));
    console.log(formData);
  };

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    if(formData.password !== formData.confirmPassword){
      setPasswordsNotMatch(true);
      return;
    }
  };

  return (
    <div className="container-register">
      <div className="wrapper">
        <form className="register-form">
          <h1>Register</h1>

          {/* Reusing InputField Component for Username */}
          <InputField
            type="text"
            name="username"
            id="username"
            placeholder="Username"
            iconClass="bx bxs-user"
            onChange={handleInputChange}
          />

          {/* Reusing InputField Component for Email */}
          <InputField
            type="email"
            name="email"
            id="email"
            placeholder="Email"
            iconClass="bx bxs-envelope"
            onChange={handleInputChange}
          />

          {/* Reusing InputField Component for Password */}
          <InputField
            type="password"
            name="password"
            id="password"
            placeholder="Password"
            iconClass="bx bxs-lock-alt"
            onChange={handleInputChange}
          />

          {/* Reusing InputField Component for Confirm Password */}
          <InputField
            type="password"
            name="confirmPassword"
            id="confirmPassword"
            placeholder="Confirm Password"
            iconClass="bx bxs-lock-alt"
            onChange={handleInputChange}
          />

          <button type="submit" className="register-button">
            Register
          </button>

          <div className="login">
            <label>
              Already have an account?{' '}
              <Link className="loginLink register-link" to="/log-in">
                Login
              </Link>
            </label>
          </div>
          {passwordsNotMatch && (
            <div className='password-not-match'>
              Passwords does not match.
            </div>
          )}
        </form>
      </div>
    </div>
  );
};

export default RegisterPage;
